tables.table_schema:
CREATE TABLE land_use_changes (
    id SERIAL PRIMARY KEY,
    area_name VARCHAR(100) NOT NULL,
    years_active INT NOT NULL,
    land_use_category VARCHAR(50) NOT NULL
);

CREATE TABLE LandUseHistory (
    id INT PRIMARY KEY,
    area_name VARCHAR(100),
    year DATE,
    land_use_type VARCHAR(50)
);

CREATE TABLE LandUseCategories (
    category_id INT PRIMARY KEY,
    category_name VARCHAR(50)
);

CREATE TABLE City ( 
    city_id INT PRIMARY KEY, 
    city_name TEXT NOT NULL 
);

CREATE TABLE LandParcel ( 
    parcel_id INT PRIMARY KEY, 
    parcel_area DOUBLE NOT NULL, 
    parcel_address TEXT NOT NULL 
);

CREATE TABLE LandUseHistory ( 
    history_id INT PRIMARY KEY, 
    parcel_id INT REFERENCES LandParcel(parcel_id), 
    city_id INT REFERENCES City(city_id), 
    year INT NOT NULL 
);

CREATE TABLE LandUseCategory ( 
    category_id INT PRIMARY KEY, 
    category_name TEXT NOT NULL, 
    description TEXT 
);

CREATE TABLE City { 
   city_id INT PRIMARY KEY, 
   city_name VARCHAR(255) NOT NULL 
}

CREATE TABLE LandParcel { 
   parcel_id INT PRIMARY KEY, 
   city_id INT, 
   parcel_address VARCHAR(255) NOT NULL, 
   land_area DECIMAL(10,2) 
}

CREATE TABLE LandUseChange { 
   change_id INT PRIMARY KEY, 
   land_use_id INT, 
   change_date DATE, 
   change_description TEXT 
}

CREATE TABLE CityPopulation { 
   city_id INT PRIMARY KEY, 
   population INT, 
   population_date DATE 
}
